import React from 'react';
import './recipe.scss';
require('dotenv').config();
console.log(process.env.API_KEY);

const Recipe = () => {
	return (
		<div className='Recipe'>
			<h1>Recipe Search</h1>
		</div>
	);
};

export default Recipe;
